let todo = [
    'element 1',
    'element 2',
    'element 3',
    'element 4',
];
const TodoList = _=>{
    return (
        <div>
            <ul>
                {todo.map(
                    (todoElement)=>
                        {
                            <li key={todoElement}>
                                {todoElement}
                        </li>
                    }
                    )
                    }
            </ul>
        </div>
    );
}
export default TodoList
